import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.css";
import "./Blog.css";
// import blogs from "./Blog";
import MbbsFeeStructure from "./blog-posts/MbbsFeeStructure";
import MbbsSeatsIndia from "./MbbsSeatsIndia";

const blogs = (props) => {
	return(
    {
      id:1,
      postName: "Test Blog 1",
      postDesc: "Test Desc 1",
      postCat: "Admission"
    },
    {
      id:2,
      postName: "Test Blog 2",
      postDesc: "Test Desc 2",
      postCat: "Admission"
    }
  );
};

// function Blog(props) {
//   return (
    
//   );
// }

class Blog extends React.Component {
  constructor(props) {
    super (props); 
  }
  render() {
    return (
      <div className="blog__page">
      <Route
        path="/2020-mbbs-fee-structure-in-india-and-abroad"
        component={MbbsFeeStructure}
      />
      <Route path="/mbbs-seats-in-india" component={MbbsSeatsIndia} />
      <div className="service__bg">
        <h1 className="service__title">Blog</h1>
      </div>
      <Container>
        <Row>
          <Col md={4}>
            <div className="blog-card">
              <div className="badge">{props.blogs.postCat}</div>
              <div className="blog-tumb">
                <img
                  src="/assets/images/blog-banners/mbbs-fee-structure-in-india-abroad.png"
                  alt=""
                />
              </div>
              <div className="blog-details">
                <Link to="/2020-mbbs-fee-structure-in-india-and-abroad">
                  <h4>{props.blogs.postName}</h4>
                </Link>
              </div>
              <div className="blog-author">
                <img src="/assets/DL.png" />
                <p>Dr Vinit Singh</p>
              </div>
            </div>
          </Col>
          <Col md={4}>
            <div className="blog-card">
              <div className="badge">Admission</div>
              <div className="blog-tumb">
                <img
                  src="/assets/images/blog-banners/mbbs-fee-structure-in-india-abroad.png"
                  alt=""
                />
              </div>
              <div className="blog-details">
                <Link to="/mbbs-seats-in-india">
                  <h4>MBBS Seats in India</h4>
                </Link>
              </div>
              <div className="blog-author">
                <img src="/assets/DL.png" />
                <p>Dr Vinit Singh</p>
              </div>
            </div>
          </Col>
          <Col md={4}>
            <div className="blog-card">
              <div className="badge">Admission</div>
              <div className="blog-tumb">
                <img
                  src="/assets/images/blog-banners/mbbs-fee-structure-in-india-abroad.png"
                  alt=""
                />
              </div>
              <div className="blog-details">
                <h4>
                  <a href="">2020 MBBS fee structure in India and abroad</a>
                </h4>
              </div>
              <div className="blog-author">
                <img src="/assets/DL.png" />
                <p>Dr Vinit Singh</p>
              </div>
            </div>
          </Col>
        </Row>
      </Container>
    </div>
    )
  }
}

export default Blog;
